BEGIN TRANSACTION;
CREATE TABLE "cases" (
"index" INTEGER,
  "province" REAL,
  "region" REAL,
  "country_code" TEXT,
  "country" TEXT,
  "time" TEXT,
  "date" TIMESTAMP,
  "n_total_cases" INTEGER,
  "n_deaths" REAL,
  "recovered" REAL,
  "growth_day" REAL,
  "cycle" REAL,
  "expect_1day_low" REAL,
  "expect_1day_up" REAL,
  "expect_2day_low" REAL,
  "expect_2day_up" REAL,
  "closest_neighbour" REAL,
  "source" TEXT
);
CREATE INDEX "ix_cases_index"ON "cases" ("index");
COMMIT;
